import Link from 'next/link';


const Navbar = () => (

    <div>
        <ul>
        <li><link href = "../pages/home"> <a> Home </a> </link> </li>
        <li><link href = "../pages/about"> <a> about </a> </link> </li>
        <li><link href = "../pages/contact"> <a> contact </a> </link> </li>
        </ul>

    </div>

);

export default Navbar;
